export const todos:Todos[] = [
  { id: 0, name: "Jog around the park" },
  { id: 1, name: "10 minutes meditation" },
  { id: 2, name: "Read for 1 hour" },
  { id: 3, name: "Pick up groceries" },
  { id: 4, name: "Complete Todo App" },
];

export type Todos = {
    id: number;
    name: string;
}
